create table item_embeddings_for_menu_two_tower_v1
(
    item_id               bigint  not null
        primary key,
    source_system_item_id varchar,
    chain_id              integer not null,
    item_embeddings       double precision[],
    dwh_entry_date        varchar,
    country_code          varchar
);

create index item_embeddings_for_menu_two_tower_v1_idx
    on item_embeddings_for_menu_two_tower_v1 (item_id);

